import React, { useState, useEffect } from 'react';
import { Link, useParams } from "react-router";
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import img1 from "../Images/axis-M2025.jpg";
import img2 from "../Images/axis-p1428.jpg";
import img3 from "../Images/axis-Q6000.jpg";

export default function home () {
  
  return (
 <>
<Container id="home container 1" fluid>
  <Row>
    <Col><h1 id="homeTitle">AXIS Camera Management</h1></Col>
  </Row>
  <Row>
    <Col><h4 id="homeText">Efficient management tool for your Axis network video products</h4></Col>
  </Row>
</Container>

<Container id="home container 2" >
  <Row>
    <Col><h5 className="paragraphs">AXIS Camera Management</h5></Col>
  </Row>
  <Row>
    <Col><h4 id="homeText">Efficient management tool for your Axis network video products</h4></Col>
  </Row>
</Container>
</>
  )}
